    <table>
      <tr className="headerRow">
        <th>Item</th>
        <th>Charge</th>
      </tr>
      <tr>
        <div>
          Your Estimate is:{" "}
          <span style={{ fontWeight: "bold" }}>${estimateValue}</span>
        </div>
      </tr>
    </table>
  );
};

export default Estimate;
